import React from "react";
import {
  StyledContainer,
  PageTitle,
  PageLogo,
  InnerContainer,
} from "./../Components/Styles";

const Login = () => {
  return (
    <>
      <StyledContainer>
        <InnerContainer>
        {<center>   position: relative</center>}
        </InnerContainer>
      </StyledContainer>
    </>
  );
};
export default Login;
